import React from "react";
import { CommunityData } from "./communityData";

const Home = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "90vh",
      }}
    >
      <h1>Laura Jankowski</h1>
      <div id="root"></div>
      {CommunityData.map((item, index) => {
        return (
          <li key={index} className={item.headerCName}>
            <div className="communityrow">
              <div className="communitycolumn">
                <img
                  className="image"
                  src={item.image}
                  alt="photo of me :)"
                  width="100%"
                ></img>
              </div>
              <div className="inforow">
                <h2>{item.name}</h2>
                <p>{item.title}</p>
                <p>{item.info}</p>
              </div>
            </div>
          </li>
        );
      })}
    </div>
  );
};

export default Home;
